import React, { useState, useEffect } from "react";

export default function States({ selectedState, onSelectState, onBack }) {
  const [states] = useState([
    "Andhra Pradesh",
    "Arunachal Pradesh",
    "Assam",
    "Bihar",
    "Chhattisgarh",
    "Goa",
    "Gujarat",
    "Haryana",
    "Himachal Pradesh",
    "Jharkhand",
    "Karnataka",
    "Kerala",
    "Madhya Pradesh",
    "Maharashtra",
    "Manipur",
    "Meghalaya",
    "Mizoram",
    "Nagaland",
    "Odisha",
    "Punjab",
    "Rajasthan",
    "Sikkim",
    "Tamil Nadu",
    "Telangana",
    "Tripura",
    "Uttar Pradesh",
    "Uttarakhand",
    "West Bengal",
    "Delhi",
    "Puducherry",
    "Jammu and Kashmir",
    "Ladakh",
  ]);

  const [currentState, setCurrentState] = useState(selectedState || null);
  const [places, setPlaces] = useState([]);

  useEffect(() => {
    if (currentState) {
      fetch(`http://localhost:8000/places?state=${encodeURIComponent(currentState)}`)
        .then((r) => r.json())
        .then(setPlaces)
        .catch((e) => console.error("Error fetching places:", e));
    }
  }, [currentState]);

  return (
    <div style={page}>
      <h1 style={heading}>Explore {currentState ? currentState : "Indian States"}</h1>

      {/* State Selection */}
      {!currentState && (
        <div style={buttonGrid}>
          {states.map((st) => (
            <button
              key={st}
              style={stateButton}
              onClick={() => {
                setCurrentState(st);
                if (onSelectState) onSelectState(st);
              }}
              onMouseEnter={(e) => (e.target.style.background = "#0056b3")}
              onMouseLeave={(e) => (e.target.style.background = "#007bff")}
            >
              {st}
            </button>
          ))}
        </div>
      )}

      {/* Places Display */}
      {currentState && (
        <div style={placesSection}>
          <button
            style={backBtn}
            onClick={() => {
              setCurrentState(null);
              if (onBack) onBack();
            }}
          >
            ‚Üê Back to States
          </button>

          {places.length === 0 ? (
            <p style={{ textAlign: "center" }}>No places found for this state.</p>
          ) : (
            <div style={placesGrid}>
              {places.map((p) => (
                <div key={p.id} style={placeCard}>
                  {/* Image carousel */}
                  <div style={photoContainer}>
                    {p.photos && p.photos.length > 0 ? (
                      p.photos.map((photo, index) => (
                        <img
                          key={index}
                          src={`http://localhost:8000/uploads/${photo}`}
                          alt={p.name}
                          style={photoStyle}
                        />
                      ))
                    ) : (
                      <div style={noImage}>No Images</div>
                    )}
                  </div>

                  {/* Text details */}
                  <h3 style={placeTitle}>{p.name}</h3>
                  <p style={placeDesc}>{p.description?.slice(0, 100)}...</p>
                </div>
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
}

/* ---- INLINE STYLES ---- */
const page = {
  padding: "20px",
  background: "#f9fafc",
  minHeight: "100vh",
};

const heading = {
  textAlign: "center",
  fontSize: "2em",
  fontWeight: "bold",
  color: "#222",
  marginBottom: "20px",
};

const buttonGrid = {
  display: "grid",
  gridTemplateColumns: "repeat(auto-fit, minmax(160px, 1fr))",
  gap: "15px",
};

const stateButton = {
  background: "#007bff",
  color: "white",
  border: "none",
  borderRadius: "8px",
  padding: "12px 20px",
  cursor: "pointer",
  fontWeight: "500",
  transition: "0.3s",
};

const placesSection = {
  textAlign: "center",
};

const backBtn = {
  marginBottom: "15px",
  padding: "8px 16px",
  background: "#ff5722",
  color: "white",
  border: "none",
  borderRadius: "6px",
  cursor: "pointer",
};

const placesGrid = {
  display: "grid",
  gridTemplateColumns: "repeat(auto-fit, minmax(280px, 1fr))",
  gap: "25px",
  marginTop: "20px",
};

const placeCard = {
  background: "white",
  borderRadius: "12px",
  boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
  overflow: "hidden",
  transition: "transform 0.3s ease",
  cursor: "pointer",
};
placeCard[":hover"] = { transform: "translateY(-5px)" };

const photoContainer = {
  display: "flex",
  overflowX: "auto",
  gap: "8px",
  scrollSnapType: "x mandatory",
  padding: "8px",
};

const photoStyle = {
  flexShrink: 0,
  width: "100%",
  height: "180px",
  borderRadius: "10px",
  objectFit: "cover",
  scrollSnapAlign: "start",
};

const noImage = {
  background: "#ddd",
  height: "180px",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  borderRadius: "10px",
  color: "#555",
};

const placeTitle = {
  fontSize: "1.2em",
  fontWeight: "bold",
  color: "#333",
  marginTop: "10px",
};

const placeDesc = {
  fontSize: "0.95em",
  color: "#666",
  padding: "0 10px 10px 10px",
};
